import "./Modal.css";

function Modal ({closeModal}: any) {
    return (
        <div className="modal-background">
        <div className="modal-container">
            <div className="modal-title">
                Error
            </div>
            <div className="modal-content">
                Um, it's empty...
            </div>
            <div className="modal-btn">
                <button onClick={() => {
                    closeModal(false);
                    }}
                    >Close</button>
            </div>
        </div>
        </div>
    );
}

export default Modal;
